function App() {
  return (
    <nav className="  ">
      <img className=" w-20 rounded-full" src={logo} alt="logo"/>
      <ul className="flex justify-end gap-6">
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
